import Stories from '../../Stories/Stories';
import Footer from '../../Footer/Footer';
import home from './home.css';
import LatestStories from '../../LatestStories/LatestStories';
function Home() {
    return (
        <div className='Home'>
            <div className='col1'>
                <Home11 />
                <div className='home2'>
                    <Home2 />
                    <Home2 />
                </div>
            </div>
            <div className='col2'>
        <Latest />
        
        <MainArticle />
        <Stories />
        <Footer />
            </div>
        </div>
    )
}
export default Home
